import { articleList } from '../datas/articles.js'

function Articles() {
    return (
		<div className='lmj-shopping-list'>
			<ul className='lmj-plant-list'>
				{articleList.map(({ name, autheur, avatar, id, text, date }) => (
					<div key={id}>

					</div>
				))}
			</ul>
		</div>
	);
}

export default Articles
